(function () {

  const menuButton = document.querySelector('.nav__category');
  const mobileOpen = document.querySelector('.main-nav__list');

  menuButton.onclick = function () {
    menuButton.classList.toggle('active');
    mobileOpen.classList.toggle('main-nav__list-open');
  };
})();

(function () {

  const humburgerButton = document.querySelector('#button');
  const humburgerButtonOpen = document.querySelector('.nav-button');
  const sidebar = document.querySelector('.mob-sidebar');
  const closed = document.querySelector('#closed');

  humburgerButton.addEventListener('click', toggleModal);
  closed.addEventListener('click', toggleModal);
  humburgerButtonOpen.addEventListener('click', toggleModal);

  function toggleModal() {
    sidebar.classList.toggle('opened');
  }
})();

(function () {
  $('.nav-button').on('click', function (e) {
    e.preventDefault();
    $('mob-sidebar').addClass('opened', 100).promise().done(function () {
      $('.nav-overlay').fadeIn(300);
      $('body, html').addClass('freeze');
    });
  });
  $('.close-btn, .mob-sidebar__link, .nav-overlay').on('click', function (e) {
    e.preventDefault();
    $('.mob-sidebar').removeClass('opened').promise().done(function () {
      $('.nav-overlay').fadeOut(300);
      $('body, html').removeClass('freeze');
    });
  });
})();

(function () {
  $('.cat-btn').on('click', function (e) {
    e.preventDefault();
    $('nav__category').addClass('active', 100).promise().done(function () {
      $('.cat-overlay, .nav__category, .cat-btn').fadeIn(300);
      $('body, html').addClass('freeze');
    });
  });
  $('.cat-overlay').on('click', function (e) {
    e.preventDefault();
    $('.nav__category').removeClass('active').promise().done(function () {
      $('.cat-overlay').fadeOut(300);
      $('body, html').removeClass('freeze');
    });
  });
})();
